import React, {Component} from 'react';
import './style.css';

class Square extends Component {
    constructor(props) {
        super(props);
        this.state = {
            value: null,
        };
    }
    render() {
        return (
        <button 
            className="square"
            onClick={() => { 
                this.setState((prevState) => {
                    return {
                        value: prevState.value === "X" ? "O": "X",
                    }

                })    
            }}
        >
            {this.state.value}
        </button>
        );
    }
}

export default Square;
